import React, { Component } from 'react'
import './App.css'
import BarChart from './BarChart'

export default class App extends Component {
  render() {
    return (
      <div className='App'>
        <div className='App-header'>
          <h2>d3ia dashboard</h2>
        </div>
        <div>
          <BarChart data={[5, 10, 1, 3]} size={[300, 300]} />
        </div>
      </div>
    )
  }
}
